import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { FaUserMd } from 'react-icons/fa';

const Navbar = () => {
  const { isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <nav className="bg-white shadow-md sticky top-0 z-50">
      <div className="container mx-auto px-4">
        <div className="flex justify-between items-center h-16">
          <Link to="/" className="flex items-center gap-2 text-2xl font-extrabold text-blue-700 tracking-tight">
            <FaUserMd className="text-blue-500 text-3xl" />
            <span>Doctor Finder</span>
          </Link>
          <div className="flex space-x-4 items-center">
            <Link to="/" className="text-gray-600 hover:text-blue-600 font-medium transition">Home</Link>
            {isAuthenticated ? (
              <>
                <Link to="/admin/dashboard" className="text-gray-600 hover:text-blue-600 font-medium transition">
                  Dashboard
                </Link>
                <button
                  onClick={handleLogout}
                  className="text-gray-600 hover:text-red-600 font-medium transition px-3 py-1 rounded hover:bg-red-50"
                >
                  Logout
                </button>
              </>
            ) : (
              <Link to="/admin/login" className="text-gray-600 hover:text-blue-600 font-medium transition">
                Admin Login
              </Link>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
